import React from 'react';
import ReactDOM from 'react-dom/client';
import './index.css';
import App from './App';
import reportWebVitals from './reportWebVitals';
import * as serviceWorkerRegistration from './serviceWorkerRegistration'; // Import service worker

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <React.StrictMode>
    <App />
  </React.StrictMode>
);

// Daftarkan Service Worker untuk offline support
serviceWorkerRegistration.register();

// Jika kamu ingin memulai mengukur performa aplikasi, panggil reportWebVitals
reportWebVitals();
